    false,nt"url": null,nt"notes": "This dataset presents environmental benefits
    of the urban forest in 2,434 block groups in Phoenix, Arizona. Carbon attributes,
    pollution removal and value, and runoff effects are calculated for each block group
    using i-Tree models (www.itreetools.org), local weather data, pollution data, EPA
    provided city boundary and land cover data, and U.S. Census derived block group
    boundary data. Temperature reduction values for Phoenix will be added when they
    become available. This dataset was produced by the US Forest Service to support
    research and online mapping activities related to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas)
    allows the user to interact with a web-based, easy-to-use, mapping application to
    view and analyze multiple ecosystem services for the contiguous United States. The
    dataset is available as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas)
    or as an EnviroAtlas map service. Additional descriptive information about each
    attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
    (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"license_title":
